import React from 'react';
import styled from 'styled-components';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Autoplay } from 'swiper';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';

const CanSlider = () => {
  return (
    <CanSliderBox>
      <Swiper
        slidesPerView={3}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination, Autoplay, Navigation]}
        className='mySwiper'
        loop={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
      >
        <SwiperSlide>
          <img src='./img/slider/can1.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can2.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can3.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can4.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can5.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can6.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can7.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can8.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slider/can9.jpg' alt='' />
        </SwiperSlide>
      </Swiper>
    </CanSliderBox>
  );
};

export default CanSlider;

const CanSliderBox = styled.div`
  height: auto;
  margin: 3rem 0;
  & .swiper-slide img {
    width: 150px;
  }
`;
